class Hello extends React.Component {
  state = {
    values: 'hello input',
  };

  changeValue(e) {
    this.setState({
      values: e.target.value,
    });
  }

  render() {
    return <input value={this.state.values} onChange={changeValue} />;
  }
}

function App() {
  return (
    <div className="App">
      <Hello />
    </div>
  );
}

export default App;
