`,paraId:316,tocIndex:49},{value:`// 2- \u5B9A\u4E49counterStore

import { makeAutoObservable } from 'mobx';

class CounterStore {
  count = 0;
  list = [1, 2, 3, 4, 5, 6];
  constructor() {
    makeAutoObservable(this);
  }
  addCount = () => {
    this.count++;
  };
  changeList = () => {
    this.list.push(7, 8, 9);
  };
  get filterList() {
    return this.list.filter((item) => item > 4);
  }
}

const counter = new CounterStore();

export default counter;
`,paraId:317,tocIndex:49},{value:`// 3- \u7EC4\u5408\u6A21\u5757\u5BFC\u51FA\u7EDF\u4E00\u65B9\u6CD5

import React from 'react';

import counter from './counterStore';
import task from './taskStore';

class RootStore {
  constructor() {
    this.counterStore = counter;
    this.taskStore = task;
  }
}

const rootStore = new RootStore();

// context\u673A\u5236\u7684\u6570\u636E\u67E5\u627E\u94FE  Provider\u5982\u679C\u627E\u4E0D\u5230 \u5C31\u627EcreateContext\u65B9\u6CD5\u6267\u884C\u65F6\u4F20\u5165\u7684\u53C2\u6570
const context = React.createContext(rootStore);

const useStore = () => React.useContext(context);
// useStore() =>  rootStore  { counterStore, taskStore }

export { useStore };
`,paraId:318,tocIndex:49},{value:`// 4- \u7EC4\u4EF6\u4F7F\u7528\u6A21\u5757\u4E2D\u7684\u6570\u636E

import { observer } from 'mobx-react-lite';
// \u5BFC\u5165\u65B9\u6CD5
import { useStore } from './store';
function App() {
  // \u5F97\u5230store
  const store = useStore();
  return (
    <div className="App">
      <button onClick={() => store.counterStore.addCount()}>{store.counterStore.count}</button>
    </div>
  );
}
